import Link from 'next/link';
import RecipeData from 'static/recipes';

const recipeContainer = {
	display: 'inline-block',
	margin: '0.25%',
	padding: '0.25%',
	width: '32%',
	height: '10em',
	border: '1px solid black',
	'border-radius': '0.25em'
}

const Recipe = (props) => (
  <div style={recipeContainer}>
  	<h1>{props.title}</h1>
  	<Link href={`/recipe?id=${props.id}`}>
  		<a>View</a>
  	</Link>
  </div>
);

export default function Recipes() {
  return (
    <div>
    	<Recipe title="BBQ Pork Mac & Cheese" id="1" />
    	<Recipe title="Chili" id="2" />
    	<Recipe title="German Potato Soup" id="3" />
    	<Recipe title="Salmon with Tomato & Lemon" id="4" />
    	<Recipe title="Sausage & Peppers" id="5" />
    	<Recipe title="Southwestern Quesadilla" id="6" />
    </div>
  );
};
